static Set<NodeLabel> convertToNodeLabelSet(Set<String> nodeLabels) {
  if (null == nodeLabels) {
    return null;
  }
  Set<NodeLabel> labels = new HashSet<NodeLabel>();
  for (String label : nodeLabels) {
    labels.add(NodeLabel.newInstance(label));
  }
  return labels;
}
